import React, { useState } from 'react';
import Navbar from '../navbar/Navbar';
import { Slider } from '../Utils/slider/Slider';

export const Home = () => {
  const [item, setItem] = useState(null);

  return (
    <div>
      <Navbar />
      <div className="slider">
      <Slider  />
      </div>
      
      {item&&item.map((k) => (
        <h1 key={k.name} style={{ position: "relative" }}>
          {k.name}
        </h1>
      ))}
    </div>
  );
};
